import axios from 'axios';

export const getPostsAPI = (num) => {
    return axios.get(`https://jsonplaceholder.typicode.com/posts`)
}

export const getPostAPI = (num) => {
    return axios.get(`https://jsonplaceholder.typicode.com/posts/${num}`)
}
